 function dispInfo(marker,time, acc_x,acc_y,acc_z,speed,heading,efficiency,consumption_energy,lost_energy,aggregation) {
     google.maps.event.addListener(marker, 'click', function(event) {
         var string = " time : " + time + "<br> longitudinal_acc : " + acc_x + "<br> lateral_acc : " + acc_y+ "<br> vertical_z : " + acc_z+ "<br> speed : " + speed+ "<br> heading : " + heading+ "<br> efficiency : " + efficiency + "<br> consumption_energy : " + consumption_energy + "<br> lost_energy : " + lost_energy + "<br> LINK_ID : " + aggregation + "<br>";
         new google.maps.InfoWindow({content:string,disableAutoPan: true}).open(marker.getMap(), marker);
         window.external.IconClick(time, acc_x,acc_y,acc_z,speed,consumption_energy,lost_energy);
     });
     google.maps.event.addListener(marker, 'rightclick', function(event) {
         window.external.IconRightClick(time);
     });
 }
